ll</TAO:LABEL>	\r\n		<TAO:LABEL key=\"btnResetNext\">New step</TAO:LABEL>\r\n		<!-- ----------------------------------------------------------------- -->\r\n		<!-- ---------          Fentre rcapitulatif             ------------ -->\r\n		<!-- ----------------------------------------------------------------- -->\r\n		<TAO:LABEL key=\"operationTxt\">Calculation method</TAO:LABEL>\r\n		<TAO:LABEL key=\"recapWindowTitle\">Calculation list</TAO:LABEL>\r\n		<!-- ----------------------------------------------------------------- -->\r\n		<!-- ---------          Fentre Choix Final             ------------ -->\r\n		<!-- ----------------------------------------------------------------- -->\r\n		<TAO:LABEL key=\"finalChoiceWindowTitle\">Final result</TAO:LABEL>\r\n		<TAO:LABEL key=\"finalChoiceWindowText\">Choose the final result !</TAO:LABEL>\r\n		<TAO:LABEL key=\"finalChoiceWindowButton\">Select</TAO:LABEL>				\r\n	</TAO:LABELS>\r\n	</tao:ITEM>\r\n	','EN',365,'generis','yy-[admin,administrators,authors]','yy-[admin,administrators,authors]','yy-[admin,administrators,authors]','2009-12-04 15:59:26'),(8,'http://127.0.0.1/middleware/demo.rdf#125187684965350','http://www.w3.org/1999/02/22-rdf-syntax-ns#type','http://www.tao.lu/Ontologies/TAOItem.rdf#Item','',366,'generis','yy-[admin,administrators,authors]','yy-[admin,administrators,authors]','yy-[admin,administrators,authors]','2009-12-04 15:59:26'),(8,'http://127.0.0.1/middleware/demo.rdf#125187684965350','http://www.tao.lu/Ontologies/TAOItem.rdf#ItemModel','http://www.tao.lu/Ontologies/TAOItem.rdf#Ctest','',367,'generis','yy-[admin,administrators,authors]','yy-[admin,administrators,authors]','yy-[admin,administrators,authors]','2009-12-04 15:59:26'),(8,'http://127.0.0.1/middleware/demo.rdf#125187684965350','http://www.w3.org/1999/02/22-rdf-syntax-ns#value','','EN',368,'generis','yy-[admin,administrators,authors]','yy-[admin,administrators,authors]','yy-[admin,administrators,authors]','2009-12-04 15:59:26'),(8,'http://127.0.0.1/m